<?php
class Solution
{

    /**
     * @param String $s
     * @return Integer
     */
    public function firstUniqChar($s)
    {
        if ($s == '') {
            return $s;
        }
        // $t1 = str_split($s);
        $t2 = count_chars($s, 1);
       
        $t1 = array_filter($t2, function ($k, $v) {
            return $k == 1;
        }, ARRAY_FILTER_USE_BOTH);
        $map= [];
        foreach ($t1 as $_k=>$_v) {
            $map[chr($_k)] = $_v;
        }
        // print_r($map);
        
        for ($i=0,$len=strlen($s); $i<$len; $i++) {
            printf("%s\n", $s[$i]);
            if (array_key_exists($s[$i], $map)) {
                return $i;
            }
        }
        return -1;
    }
}

$s = new Solution();
$str = "loveleetcode"; // 2
$str = '';
echo $res = $s->firstUniqChar($str);
